import React from 'react';
import './SolutionPage.css';

const SolutionPage = () => {
  const services = [
    {
      id: 1,
      title: "Data Analytics & AI/ML",
      image: "/images/solution-data-analytics.jpg",
      description: "Advanced data science capabilities, predictive algorithms, machine learning, and artificial intelligence solutions for government agencies."
    },
    {
      id: 2,
      title: "Cloud & Infrastructure Engineering", 
      image: "/images/solution-cloud-infrastructure.jpg",
      description: "Cloud computing solutions with AWS and Azure, infrastructure modernization, and scalable architecture design."
    },
    {
      id: 3,
      title: "Cybersecurity",
      image: "/images/solution-cybersecurity.jpg", 
      description: "Advanced cybersecurity services, threat protection, security assessments, and compliance solutions for federal environments."
    },
    {
      id: 4,
      title: "Agile Software Development",
      image: "/images/solution-agile-development.jpg",
      description: "Cross-platform software development, agile methodologies, and custom application development for mission-critical systems."
    },
    {
      id: 5,
      title: "IT Support Services",
      image: "/images/solution-it-support.jpg",
      description: "Comprehensive IT support, help desk services, system maintenance, and technical assistance for government operations."
    }
  ];

  return (
    <div className="solution-page">
      <div className="solution-page-container">
        {/* 页面标题 */}
        <div className="solution-page-header">
          <h1 className="solution-page-title">IT SERVICE</h1>
        </div>

        {/* 服务列表 */}
        <div className="solution-services">
          {services.map((service) => (
            <div key={service.id} className="solution-service-card">
              <div className="service-background"></div>
              <div className="service-line"></div>

              <div className="service-content">
                <div className="service-image-container">
                  <img 
                    src={service.image}
                    alt={service.title}
                    className="service-image"
                    onError={(e) => {
                      e.target.style.display = 'none';
                      e.target.nextSibling.style.display = 'flex';
                    }}
                  />
                  <div className="service-image-placeholder" style={{display: 'none'}}>
                    <span>{service.title} Image</span>
                  </div>
                </div>

                <div className="service-info">
                  <h2 className="service-title">{service.title}</h2>
                  <p className="service-description">{service.description}</p>
                  <button className="service-button">
                    <span className="button-symbol">→</span>
                    <span className="button-text">Learn more</span>
                  </button>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default SolutionPage;
